#[test]
fn test_linear_exec() {
    let mut execstate = LinearExecutionState::default();
    let run_count = linear_exec(&mut execstate);

    assert_eq!(run_count, 1000);
    assert_eq!(execstate.store.value[1000], 1000);

    let run_count = linear_exec(&mut execstate);
    assert_eq!(run_count, 0);
}
